  false,\n\t\"url\": null,\n\t\"notes\": \"Chemical, physical and profile oceanographic
  data were collected aboard the F. G. Walton Smith in the Gulf of Mexico from 2010-06-01
  to 2010-06-06 in response to the Deepwater Horizon Oil Spill event on April 20,
  2010, by the Subsurface Monitoring Unit (SMU), which consisted of multiple government
  and corporate agencies. These data include CDOM fluorescence, conductivity, dissolved
  oxygen, hydrostatic pressure, salinity, sound velocity, temperature and water density.
  The instruments used to collect these data included CTD, fluorometer and oxygen
  meter along with other physical sampling devices. More specific information about
  each data set is located in their individual metadata records. The CTD data underwent
  preliminary quality assurance and control procedures at the National Coastal Data
  Development Center (NCDDC). This data set also contains products created for use
  in real time analysis and decision support. These products may include charts, graphs,
  maps, plots, and GIS formatted data files. Cruise level information consisting of
  data management documents, cruise reports and plans, videos and pictures, and other
  miscellaneous documentation were gathered by the data managers. (NODC Accession
  0069115)\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
